import React from 'react'
import EmailInput from '../../components/ui/NumberInput'
import TextInput from '../../components/ui/TextInput'
import useFormContext from '../../Hooks/useFormContext'

const BasicInfo = () => {
  const { userData, handleChange } = useFormContext()

  // console.log(userData)
  return (
    <div>
      <h1>Basic Info</h1>
      <TextInput
        fieldName="firstName"
        placeholder="Alan"
        fieldValue={userData.firstName}
        handleChange={handleChange}
      />
      <TextInput
        fieldName="lastName"
        placeholder="Turing"
        fieldValue={userData.lastName}
        handleChange={handleChange}
      />
      <EmailInput
        pattern=".+@\.edu"
        placeholder="alan.turing@mail.com"
      />
    </div>
  )
}

export default BasicInfo
